let commentDepth = ref 0;  (* Current comment nesting *)

(* Distinguish keywords from identifiers: *)

let keyword s =
    match s with
    | "else"      -> ELSE
    | "begin"     -> BEGIN        
    | "end"       -> END
    | "false"     -> CSTBOOL false
    | "if"        -> IF
    | "in"        -> IN
    | "let"       -> LET
    | "val"       -> VAL
    | "fun"       -> FUN
    | "fn"        -> FN
    | "and"       -> AND
    | "not"       -> NOT
    | "then"      -> THEN
